import { useState, useEffect } from "react";
import {
    BrowserRouter,
    Routes,
    Route,
    Switch
} from 'react-router-dom';
import {
    Flex,
    Box,
    FormControl,
    Input,
    FormHelperText,
    Button,
    Text,
    Avatar,
    Spacer,
    Link,
    Center
} from '@chakra-ui/react';


const Login = () => {
    const [credentials, setCredentials] = useState({
        email: "",
        password: ""
    });
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [phone, setPhone] = useState("");
    const [error, setError] = useState(false)
    const [authenticate, setAuthenticate] = useState(false);

    const handleChange = () => {

    }

    const handleSubmit = () => {

    }

    const login = () => {

    }

    const logout = () => {

    }

    
    return (

        <Box
            bg='url(images/login_bg.png)'
            display='flex'
            alignItems= 'center'
            justifyContent='center'
            left='100%'
            top='100%'
            tm="500"
        >
            <Box
                style={{
                    //flexDirection: 'column',
                    display: 'flex',
                    //justifyContent: 'center',      
                }}
                position="fixed"
                p={1}
                border="1px solid black.200"
                top="15%"
                //left="10%"
                w='60%'
                h='70%'
                bg='url(images/login_bg.png)'
                //bg='#27ABE5E5'
            >
                <form
                    bg='url(images/login_bg.png)'
                    style={{
                        paddingLeft: '5%',
                        paddingRight: '5%',
                        paddingTop: '2%',
                        width: '100%',

                    }}
                >
                    <div
                        className="centered"
                        Style={{
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center',
                        }}
                    >
                        <Avatar
                            h={12} w={24}
                            borderRadius={50}
                            src="images/logo.png"
                            //marginLeft='50%'
                            //marginRight='50%'
                            left='40%'
                        />
                    </div>
                    <Box display='flex' >
                        <Flex>
                            <Text color="#D9D9D9" fontSize="2xl" fontFamily="sans-serif" fontWeight="bolder">
                                Sign In /
                            </Text>
                        </Flex>
                        <Flex>
                            <Text color="#27ABE5" fontSize="2xl" fontFamily="sans-serif" fontWeight="bolder">
                                Sign Up
                            </Text>
                        </Flex>
                    </Box>
                    <Box
                        pr={20}
                        pl={20}
                    >
                        <Box
                            mb={2}
                            mt={3}
                        >
                            <FormControl>
                                <FormHelperText
                                    color='#27ABE5'
                                    fontSize='xs'
                                >
                                    Email
                                </FormHelperText>
                                <Input
                                    h={27}
                                    fontSize='xs'
                                    bg='#D9D9D9'
                                    borderRadius={8}
                                    type="email"
                                    name="email"
                                    onChange={handleChange}
                                    value={(event) => setUsername(event.target.value)}
                                />
                            </FormControl>
                        </Box>
                        <Box
                            //className="blue-200 rounded-2xl"
                            mb={2}
                        >
                            <FormControl>
                                <FormHelperText
                                    color='#27ABE5'
                                    fontSize='xs'
                                >
                                    Phone Number
                                </FormHelperText>
                                <Input
                                    h={27}
                                    fontSize='xs'
                                    bg='#D9D9D9'
                                    borderRadius={8}
                                    type="phone"
                                    name="phone"
                                    onChange={handleChange}
                                    value={(event) => setPhone(event.target.value)}
                                />
                            </FormControl>
                        </Box>
                        <Box
                            mb={2}
                        >
                            <FormControl>
                                <FormHelperText
                                    color='#27ABE5'
                                    fontSize='xs'
                                >
                                    Password
                                </FormHelperText>
                                <Input
                                    h={27}
                                    fontSize='xs'
                                    bg='#D9D9D9'
                                    borderRadius={8}
                                    type="password"
                                    name="password"
                                    onChange={handleChange}
                                    value={(event) => setPassword(event.target.value)}
                                />
                            </FormControl>
                        </Box>
                    </Box>
                    <Box
                        className="centered"
                        display='flex'
                        alignItems='center'
                        justifyContent='center'
                        flexDirection='column'
                    >
                        <Button
                            display='flex'
                            //className="centered rounded-5xl"
                            bg='#27ABE5'
                            borderRadius={20}
                            color='white'
                            type="submit"
                            fontSize='13'
                        >
                            Sign In
                        </Button>
                        <Text
                            m={1}
                            color='black'
                            fontWeight='500'
                        >
                            OR
                        </Text>

                        <Button
                            display='flex'
                            //className="centered rounded-5xl"
                            bg='#27ABE5'
                            color='white'
                            fontSize='12'
                            h='29'
                            borderRadius={8}
                            type="submit">
                            Sign In with Google
                        </Button>
                        <Button
                            mt={2}
                            display='flex'
                            //className="centered rounded-5xl"
                            bg='#27ABE5'
                            color='white'
                            fontSize='11'
                            h='29'
                            borderRadius={9}
                            type="submit">
                            Sign In with Facebook
                        </Button>
                    </Box>
                </form>
                <Box
                    
                    m={10}
                    display='flex'
                    alignItems='center'
                    justifyContent='center'
                    flexDirection='column'
                //bg='#27ABE5'
                >
                    <Flex>
                        <Text color="white" fontSize="3xl" fontFamily="sans-serif" >
                            Welcome
                        </Text>
                    </Flex>
                    <Flex>
                        <Text color="white" fontSize="xs" fontFamily="sans-serif">
                            To keep connected with us please sign in with your personal info
                        </Text>
                    </Flex>
                    <Button
                        mt={49}
                        display='flex'
                        //className="centered rounded-5xl"
                        bg='#FFFFFF'
                        borderRadius={20}
                        fontWeight='bold'
                        color='#27ABE5'
                        type="submit"
                        fontSize='13'
                        h='29'
                    >
                        Sign In
                    </Button>
                </Box>

            </Box>


        </Box>
    );
};

export default Login;
